#DEFCON_BEGIN
#!/bin/bash #<--- Leave shebang here so defcon file will have it as 1st line.
#varkey-------------------------------------------------------------------------
# BDIR .......... BUILT-IN FREECANS DIRECTORY
# CCMD .......... COPY COMMAND
# CHAIND ........ WATCHER VARIABLE
# CMD_LN ........ GLOBAL COMMAND LINE HOLDER
# DOCDIR ........ DOCUMENTATION DIRECTORY
# DST ........... DESTINATION
# ENAM .......... EXECUTION NAME
# ET ............ PARALLEL CONNECTION EXTENSION
# EXCT .......... ID FLUSH VARIABLE
# FDIR .......... SHARED FUNCTIONS DIRECTORY
# FNM ........... PARALLEL COLLECTION FILENAME
# GEOX .......... X COORDINATE HOLDER
# GEOY .......... Y COORDINATE HOLDER
# HGDR .......... COLLECTION DIRECTORY
# GOINST ........ LOCAL INSTALL VARIABLE
# HYP ........... HYPER-SPEED COMMAND
# IDIR .......... INSTALLATION DIRECTORY
# IWRD .......... LOCAL INSTALLATION VARIABLE
# KSCN .......... SSH KEY SCAN COMMAND
# KSCL .......... SLOW SSH KEY SCAN COMMAND
# KEYTYPE ....... TYPE OF SSH KEY
# KEYGENCMD ..... KEY GENERATION COMMAND
# KWNH .......... LOCAL SSH KNOWN HOSTS FILE
# LDIR .......... LIBRARY DIRECTORY
# MDIR .......... WORKING DIRECTORY
# MENV .......... CLASS C NETWORK ENVIRONMENT
# MLST .......... MASTER LIST
# MNAM .......... FRAMEWORK INSTALLER
# MPLD .......... HTK STANDARD PAYLOAD TAG
# MVL ........... INSTALLED SCRIPT
# PDIR .......... PRECAN DIRECTORY
# PNAM .......... SOFTWARE PACKAGE NAME
# PLUSH ......... SYSTEM-WIDE PLUSH PROFILE
# QSCMD ......... HYPER RSYNC COMMAND
# SCREENCOUNT ... PARALLEL KEY COPY SCREEN COUNTER
# SRC ........... SOURCE
# SSCMD ......... SERIAL RSYNC COMMAND
# TCMD .......... TUNNEL COMMAND
# THSBL ......... LOCAL BOOLEAN VARIABLE
# USR ........... REMOTE USER
# WRLDZ ......... WAKE-ON-LAN NICS
# XCMD .......... TUNNELED X COMMAND

#globvars-----------------------------------------------------------------------
DN=/dev/null
MENV=10.0.0
MY_SSH_PORT="-p 22"
MY_SCP_PORT="-P 22"
TCMD="ssh $MY_SSH_PORT -2"
XCMD="ssh $MY_SSH_PORT -2 -X"
CCMD="scp $MY_SCP_PORT -r -2"
HGDR=get.$$
KEYTYPE=rsa
KEYGENCMD="ssh-keygen -t $KEYTYPE -P '' -f ~/.ssh/id_${KEYTYPE}"
KSCN="ssh-keyscan $MY_SSH_PORT -t rsa1,dsa,rsa -T 10 -f"
KSCL="ssh-keyscan $MY_SSH_PORT -t rsa1,dsa,rsa -T 5"
KWNH=~/.ssh/known_hosts
ENAM=$0
MNAM=$(basename $ENAM)
MDIR=/var/lib/hyperf
LDIR=$MDIR/lib
MLST=$MDIR/master.list
PDIR=$LDIR/precans
BDIR=$LDIR/freecans
FDIR=$LDIR/funcs
PLUSH=bash.bashrc.local
DHPRF=~/.hyperf
PBFL=$DHPRF/$PLUSH.pre-install.backup
BRCP=$DHPRF/dot.bashrc__pre-boost.backup
VRCP=$DHPRF/dot.vimrc__pre-boost.backup
test -e /etc/init.d/sysresccd -a -e /mnt/cdrom/sysrcd.dat && PLUSH=bash/bashrc
test -e /etc/init.d/sysresccd -a -e /etc/gentoo-release && PLUSH=bash/bashrc
test -e $FDIR/plush.fnc && . $FDIR/plush.fnc
WRLDZ=$(IP 2>$DN|cut -d\. -f1-3|sed 's/$/.0/')
SRC=$1
DST=$2
USR=root
HYP="screen -d -m"
#SSCMD="rsync --inplace -HIAXPav -e ssh --delete"
SSCMD="rsync -SHIAXPav -e ssh --delete"
#QSCMD="rsync --inplace -HIAXa   -e ssh --delete"
QSCMD="rsync -SHIAXa   -e ssh --delete"
IDIR=/root/bin
MVL=$IDIR/htk.sh
MPLD=HYPERF_0
#DEFCON_END

#funcs-------------------------------------------------------------------------
back_up_pre_existing_hyperf_libs_and_docs (){
   #Takes no args.
   #
   #Self explanatory.
   if [ -d $LDIR/common -o -d $DOCDIR ] ; then
      tell_us_what_you_do
      tar -zcf /var/lib/hyperf.$$.bak.tgz $MDIR/lib $DOCDIR 2>$DN
   fi
}
check_for_existing_install_collision__or__set_management_action (){
   #Takes 1 arg:        Arg 1 is management action
   #                    Arg 1 can be either 'ins' or 'upg'
   #
   if [ $1 = ins ];then
      if [ -x $MVL ];then
         echo "--------------------------------------------------"
         echo "$MVL APPEARS TO BE ALREADY INSTALLED"
         echo "--------------------------------------------------"
         echo "--------------------------------------------------------"
         echo "EXECUTE 'htk.sh --upg' TO RE-LINK, REINSTALL, or UPGRADE"
         echo "--------------------------------------------------------"
         echo Exiting ; exit
      fi
      IWRD=INSTALL
   elif [ $1 = upg ];then
      IWRD=UPGRADE
   fi
}
copy_kit_to_root_bin__then_install__or__update_command_links_there (){
   #Takes no args
   #
   tell_us_what_you_do
   #
   #Copy kit to root bin...
   cp $ENAM $MVL 2>$DN
   #
   #Install or update command links...
   ol_ul_prompt - "EXECUTING $IWRD OF COMMAND LINKS IN $IDIR/"
   chmod +x $MVL
   pushd $IDIR 2>&1 >$DN
   for f in $(cat $MVL|grep -E "\<(h|n|s|x)\.[^ ]*\)" htk.sh|grep -v grep |tr -d ")") ; do
      cp -fl $MVL $f
   done
   #
   #Purge dead links...
   ol_ul_prompt - "PURGING DEAD LINKS IN $IDIR/"
   for d in $(ls [mhnsx].*|xargs -i basename {});do
      grep "$d" $MVL >$DN || rm $d
   done
   popd 2>&1 >$DN
}
create_installation_and_documentation_directories_by_os_type (){
   #Takes no args.
   #
   #Self explanatory.
   set_docdir_by_os_type
   mkdir -p $IDIR $DOCDIR
}
display_management_action (){
   #Takes no args.
   #
   #Displays the management action being taken.
   #
   ol_ul_prompt = $IWRD
}
extract_yolk_by_pattern_1__from__file_2 (){
   # Takes 2 args:      1 is unique yolk (payload) name suffix
   #                    2 is name of FILE to extract yolk from
   #
   # What this function does:
   # This is the primary extractor function of the payload.  It extracts a yolk
   # (i.e. an embedded payload) from a file, based on a pattern provided to it
   # as an argument.  It looks for a beginning and ending delineator lines
   # for the payload, and uses 'cat', 'sed', and 'tail' to output just the lines
   # between those delineators.
   #
   # The patterns that delineate the yolk must contain 'BEGIN_YOLK_' and
   # 'END_YOLK_', respectively.
   # Example beginning delineator: BEGIN_YOLK_HYPERF_0
   # Example ending    delineator:   END_YOLK_HYPERF_0
   #
   # Notice how the single pattern 'HYPERF_0' can then delineate the start and
   # end of a yolk.
   #
   # A file can contain multiple yolks, as long as the delineators are unique in
   # the file.
   #
   # Each payload is required to be base64 encoded.
   #
   # This function outputs the decoded stream on standard out (stdout).
   #
   # Any other command that can receive stdin can take the stream and deal with
   # it.  So, a base64 encoded tarball can be embedded inside a script, for
   # example.
   #
   # How the code works:
   # 1. The 'cat' line, below, streams the file...
   # 2. The 1st 'sed' command filters the stream down to only the lines between
   #    STRING1 and STRING2, which delineate the yolk.
   # 3. The 2nd 'sed' command trims out the ending delineator line from the
   #    stream.
   # 4. The 'tail' line trims out the first delineator line from the stream.
   # 5. The 'openssl' command base64-decodes the stream
   #
   local STRING1=^#BEGIN_YOLK_${1}
   local STRING2=^#END_YOLK_${1}
   #Return error if incorrect number of args
   if [ $# -ne 2 ] ; then
      EE=33
      echo "Wrong number of arguments."
      echo "You must provide a yolk suffix name and file to extract from."
      return $EE
   fi
   #Extract the desired yolk from the target file
   cat $2 | \
   sed -n "/${STRING1}/,/${STRING2}/p" | \
   sed -n '$!p' | \
   tail -n+2  | \
   openssl base64 -d
}
handle_the_full_auto__plush__cqt__and__grouper__bits (){
   #Takes no args.
   #
   #Auto-creates backups,
   case $FULLAUTO in
      yes)
         mkdir -p $DHPRF
         if [ -e /etc/$PLUSH ] ; then
            cp -n /etc/$PLUSH $PBFL.orig
         fi
         cp $BDIR/plush.profile /etc/$PLUSH
         bash $BDIR/cqt.sh
         bash $BDIR/grouper.sh
         ;;
   esac
}
htk_mgmt_action (){
   #Takes 1 arg:        Arg 1 is installation type to perform
   #                    Arg 1 can be either 'ins' or 'upg'
   case $FULLAUTO in
      yes)
         local DELAY20=0
         local DELAY10=0
         ;;
      *)local DELAY20=20
        local DELAY10=10
        ;;
   esac
   check_for_existing_install_collision__or__set_management_action $1
   display_management_action
   test_for_os_type_and_set_appropriately
   ol_ul_prompt = $OS_TYPE
   create_installation_and_documentation_directories_by_os_type
   copy_kit_to_root_bin__then_install__or__update_command_links_there
   set_up_ssh
   back_up_pre_existing_hyperf_libs_and_docs
   prompt_to_tap_enter_or_this_many_second_continue $DELAY10
   #############################################################################
   # NOTE: Do *NOT* set $DELAY10, just above, to a static value, because it may
   #       need to be zero'ed out by the full-auto installation process.
   #############################################################################
   install_or_upgrade_the_hyperf_payload
}
install_or_upgrade_the_hyperf_payload (){
   #Takes no args.
   #Self explanatory.
   #
   pushd /tmp 2>&1 >$DN
   echo
   ol_ul_prompt - "EXECUTING $IWRD OF HYPERF PAYLOAD:"
   extract_yolk_by_pattern_1__from__file_2 $MPLD $MVL | tar --no-overwrite-dir -zxf - -C / 2>$DN
   case $OS_TYPE in
      mac)
         #Perform special mac documentation installation
         extract_yolk_by_pattern_1__from__file_2 $MPLD $MVL | tar --wildcards -zxf - -C /opt usr/* 2>$DN
         ;;
   esac
   #Fix ownership and permissions 
   chown -R root.root $DOCDIR $MDIR 2>$DN
   chmod a=r $BDIR/*
   echo
   echo
   install_or_upgrade_plush
   parse_htk_functions_and_export_to__hyperf_fnc__file
   install_or_upgrade_the__plush__exported_library_files
   indicate_that_the_install_or_upgrade_is_complete
   handle_the_full_auto__plush__cqt__and__grouper__bits
}
install_or_upgrade_plush (){
   #Takes no args.
   #Self explanatory.
   #
   echo "Would you like to $IWRD the PLUSH profile?"
   echo "Type $IWRD, if yes. [Def=no in 20 secs]"
   read -t $DELAY20 GOINST
   test -z $THSBL 2>$DN && THSBL=no
   if [ $GOINST = $IWRD ] 2>$DN ; then
      ol_ul_prompt - "EXECUTING $IWRD OF PLUSH PROFILE:"
      cp $BDIR/plush.profile /etc/$PLUSH
      sed -i "s@plush=[[:graph:]].*\>@plush=/etc/$PLUSH@g" /etc/$PLUSH
   else
      echo "In case you want to install it later,"
      echo "you can find plush in $BDIR"
   fi
}
install_or_upgrade_the__plush__exported_library_files (){
   #Takes no args.
   #
   #Self explanatory.
   if [ ! -e $FDIR/plush.fnc -o ! -e $FDIR/plush_a2v -o $IWRD = UPGRADE ];then
      ol_ul_prompt - "EXECUTING $IWRD OF EXPORTED PLUSH LIBRARIES:"
      #Plush was installed above, so source it in to use some of its functions
      . $BDIR/plush.profile
      #Put a shebang at the beginning of exported plush.fnc file.
      echo "#!/bin/bash"                                             > $FDIR/plush.fnc
      #Export plush functions.
      bgrep "^\#funcs" "^#changelog" $BDIR/plush.profile |head -n-1 >> $FDIR/plush.fnc
      #Dump out the comment header of the plush_a2v file
      plush_a2v_comments > $FDIR/plush_a2v
      #Convert plush aliases to a variables lib and dump the plush_a2v file
      plush_alias_2_vars >> $FDIR/plush_a2v
      chown root.root $FDIR/{hyperf,plush}.fnc $FDIR/plush_a2v
      chmod 444 $FDIR/{hyperf,plush}.fnc $FDIR/plush_a2v
   else
      #Don't upgrade the payload. Instead, dump it to tmp and inform the user.
      extract_yolk_by_pattern_1__from__file_2 $MPLD $MVL > /tmp/payload.tgz
      echo "I found previously installed hyperf components,"
      echo "but the --UPGRADE option was not used."
      read -t 1
      echo "I do not want to overwrite the originals."
      read -t 1
      echo "I am Extracting payload.tgz to /tmp/ :"
      read -t 1
      echo "Manual extraction of the payload will be required,"
      echo "or you can re-run htk.sh with the --UPGRADE option"
      echo "--------------------------------------------------"
   fi
}
