}
test_for_os_type_and_set_appropriately (){
   #Takes no args.
   #
   #Self explanatory.
   #
   tell_us_what_you_do
   cON
   #Set OS_TYPE to MacOS, Cygwin, or Linux
   if [[ $OSTYPE =~ darwin ]] ; then
      OS_TYPE=mac
      return
   elif [[ $MACHTYPE =~ darwin ]] ; then
      OS_TYPE=mac
      return
   elif [[ $OSTYPE =~ apple ]] ; then
      OS_TYPE=mac
      return
   elif [[ $MACHTYPE =~ apple ]] ; then
      OS_TYPE=mac
      return
   elif [[ $OSTYPE =~ cygwin ]] ; then
      OS_TYPE=cygwin
      return
   elif [[ $MACHTYPE =~ cygwin ]] ; then
      OS_TYPE=cygwin
      return
   else
      OS_TYPE=linux
      return
   fi
   cOFF
}

